import React from 'react'
import Col from 'react-bootstrap/Col';
const Test = (prop) => {
    prop.data.map((r) => {
        console.log(r);
    })
  return (
       prop.data.map((r, index) => {
        return (
            <>
            <Col>
            <div key={r.id}>

                <h1>{r.id}</h1>
                <h1>{r.first_name}</h1>
                <h1>{r.last_name}</h1>
                <h1>{r.address}</h1>
            </div>
            </Col>
            </>
        )
       }) 
  )
}

export default Test
